const DesktopNavigation = () => {
  const [value, setValue] = useState(0);
const classes=useStyles();
  const handleChange = (event:any, newValue:any) => {
    setValue(newValue);
  };
  return (
    <Tabs
      value={value}
      onChange={handleChange}
      aria-label="nav tabs example"
      className={classes.tabs}
    >
      <Tab className={classes.tab} label="Home" component={Link} to="/" />
      <Tab className={classes.tab} label="About us" component={Link} to="/about" />
      <Tab className={classes.tab} label="Contact us" component={Link} to="/contact" />
    </Tabs>
  );
};

const MobileNavigation = () => {
  const [openDrawer, setOpenDrawer] = React.useState(false);
  const classes=useStyles();
  const iOS =
    typeof navigator !== 'undefined' &&
    /iPad|iPhone|iPod/.test(navigator.userAgent);

  return (
    <React.Fragment>
      <SwipeableDrawer
        disableBackdropTransition={!iOS}
        disableDiscovery={iOS}
        open={openDrawer}
        onClose={() => setOpenDrawer(false)}
        onOpen={() => setOpenDrawer(true)}
      >
        <Box className={classes.toolbarMargin} />
        <Paper>
          <List disablePadding>
            <ListItem
              divider
              button
              component={Link}
              to="/"
              onClick={() => setOpenDrawer(false)}
            >
              <ListItemText disableTypography>Home</ListItemText>
            </ListItem>
            <ListItem
              divider
              button
              component={Link}
              to="/about"
              onClick={() => setOpenDrawer(false)}
            >
              <ListItemText disableTypography>
              <IconButton
                sx={{ top: "3px" }}
                size="large"
                edge="end"
                aria-label="account of current user"
                color="inherit"
                id="basic-button"
                aria-controls={open ? 'basic-menu' : undefined}
                aria-haspopup="true"
                aria-expanded={open ? 'true' : undefined}
                onClick={handleClick5}></IconButton>
                Design Ideas
                </ListItemText>
              <Menu>

              </Menu>
            </ListItem>
            <ListItem
              divider
              button
              component={Link}
              to="/contact"
              onClick={() => setOpenDrawer(false)}
            >
              <ListItemText disableTypography>Home Interior</ListItemText>
            </ListItem>
          </List>
        </Paper>
      </SwipeableDrawer>
      <IconButton
       className={classes.menuIconContainer}
        onClick={() => setOpenDrawer(!openDrawer)}
        disableRipple
      >
        <MenuIcon className={classes.hamburgerMenuIcon} />
      </IconButton>
    </React.Fragment>
  );
};

const Navbar = () => {
  const isMobileMode = useMediaQuery(theme.breakpoints.down('sm'));
  const classes=useStyles();
  return (
    <Fragment>
      <AppBar
        position="fixed"
        className={classes.appbar}
        color="secondary"
        elevation={9}
      >
        <Toolbar disableGutters={true}>
          <Button
            disableRipple
            component={Link}
            to="/"
            className={classes.logoContainer}
          >
           FURNKA
          </Button>
          {isMobileMode ? <MobileNavigation /> : <DesktopNavigation />}
        </Toolbar>
      </AppBar>
    </Fragment>
  );
};

export default Navbar;
